-- Table structure for table `users`

-- DROP TABLE IF EXISTS Users;
CREATE TABLE Users
		(
			ID					int,
			First_Name			varchar(25),
			Last_Name			varchar(25),
			Phone_Num			varchar(12) DEFAULT NULL,
			eMail				varchar(35) DEFAULT NULL,
			CustomerType		varchar(25) DEFAULT NULL,
			CardNum				varchar(19) DEFAULT NULL,
			Pswd				varchar(10),
			IsLoggedIn			INT			DEFAULT 0,
			Approved			int			DEFAULT 0,
			AssociatedBranch	int			DEFAULT NULL,
            Credit				double 		DEFAULT 0,
			PRIMARY KEY (`First_Name`,`Last_Name`,`Pswd`),
			FOREIGN KEY (AssociatedBranch)	REFERENCES Restaurants (Restaurant_ID)
		);


