-- Table structure for table `orders`

-- DROP TABLE IF EXISTS Orders	;
CREATE TABLE Orders
		(
			Order_number			int AUTO_INCREMENT,
			Delivery_Type		varchar(15),
            city				varchar(15) NOT NULL,
            street				varchar(25),
            address_num			int,
            workplace			varchar(25) default null,
            nickname			varchar(25) NOT NULL,
			Receiver_Name		varchar(25) DEFAULT NULL,
            Receiver_LastName	varchar(25) DEFAULT NULL,
            Receiver_Password	varchar(25) DEFAULT NULL,
			Phone_num			varchar(12) DEFAULT NULL,
			Total_price			double DEFAULT NULL,
			Order_Status		varchar(20) NOT NULL,
			Restaurant_ID		int DEFAULT NULL,
            OrderType			varchar(10),
			Order_TS			varchar(30) DEFAULT NULL,
			Order_Approved_By_Supplier	varchar(30) DEFAULT NULL,
			Order_Delivered_TS	varchar(30) DEFAULT NULL,
			Order_Expected_TS	varchar(30) DEFAULT NULL,


			PRIMARY KEY ( Order_number ),
			FOREIGN KEY (Restaurant_ID)	REFERENCES Restaurants (Restaurant_ID),
            FOREIGN KEY (Receiver_Name,Receiver_LastName,Receiver_Password)	REFERENCES usersExternal (First_Name,Last_Name,Pswd),
			FOREIGN KEY (city, street) REFERENCES address (cities, streets),
            FOREIGN KEY (Delivery_Type)	REFERENCES deliverymethods (method)
		);

